import React, { useState, useEffect } from "react";
import axios from "axios";

const GameList = () => {
  const { gameList, setGameList } = useState(null);
  useEffect(() => {
    axios.get("https://wild-games.herokuapp.com/api/v1").then((response) => {
      setGameList(response.data.map((item) => item));
    });
  }, []);
  return gameList !== null ? (
    <>
      {gameList.map((item) => (
        <div>
          <p>{item.name}</p>
          <img src={item.background_image} alt="pictures" />
          <p>{item.rating}</p>
        </div>
      ))}
    </>
  ) : (
    <p>Pas de Data</p>
  );
};

export default GameList;
